                var html_224d1cd0b607d2fb8c5857c707f50f12 = $(`<div id="html_224d1cd0b607d2fb8c5857c707f50f12" style="width: 100.0%; height: 100.0%;"><b>Имя пользователя: nan<br>Название истории: Жизнь в общаге КАСИ<br></b>История: С 91 по 97 учился в архитектурном и жил во 2-м общежитии. За 6 лет было очень много интересных событий и с общагой связано много воспоминаний. Помню как у Бека Борбиева родился сын, а он сам жил в соседнем третьем общежитии. Так вот, он в компании друзей шёл в сторону своей общаги и пел песни. Они остановились возле нашего общежития и почти все студенты выбежали на улицу послушайте его песни и поздравить его с рождением сына.<br><img src='data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDAAgGBgcGBQgHBwcJCQgKDBQNDAsLDBkSEw8UHRofHh0aHBwgJC4nICIsIxwcKDcpLDAxNDQ0Hyc5PTgyPC4zNDL/2wBDAQkJCQwLDBgNDRgyIRwhMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjL/wAARCALuA+gDASIAAhEBAxEB/8QAHwAAAQUBAQEBAQEAAAAAAAAAAAECAwQFBgcICQoL/8QAtRAAAgEDAwIEAwUFBAQAAAF9AQIDAAQRBRIhMUEGE1FhByJxFDKBkaEII0KxwRVS0fAkM2JyggkKFhcYGRolJicoKSo0NTY3ODk6Q0RFRkdISUpTVFVWV1hZWmNkZWZnaGlqc3R1dnd4eXqDhIWGh4iJipKTlJWWl5iZmqKjpKWmp6ipqrKztLW2t7i5usLDxMXGx8jJytLT1NXW19jZ2uHi4+Tl5ufo6erx8vP09fb3+Pn6/8QAHwEAAwEBAQEBAQEBAQAAAAAAAAECAwQFBgcICQoL/8QAtREAAgECBAQDBAcFBAQAAQJ3AAECAxEEBSExBhJBUQdhcRMiMoEIFEKRobHBCSMzUvAVYnLRChYkNOEl8RcYGRomJygpKjU2Nzg5OkNERUZHSElKU1RVVldYWVpjZGVmZ2hpanN0dXZ3eHl6goOEhYaHiImKkpOUlZaXmJmaoqOkpaanqKmqsrO0tba3uLm6wsPExcbHyMnK0tPU1dbX2Nna4uPk5ebn6Onq8vP09fb3+Pn6/9oADAMBAAIRAxEAPwCpijFLijFfZHgiYopaKAEoxS0EUBcSkpcUYoAKSlopsBKDzRiilYBNtGKWigYlLRRQITFGKWigBKKMUYosFwpMUuKMUwuNxRg06ilYLjaKdSYoASggUuKMUANxS4pcUlABSUpGKKoBKKMUtJgJRS0YoC43FGKWimFxMUUtJQAmKMUuKKAEopaKAEopaKAEoopaAuJRS0VIXExRS0UwuJRS0UgEopcUYpoBKWlxSYoC4UUYophcSiloxSYXEopcUYpWEFFLRTASlooxQgCijFGKYXDFGKWikO4lGKWgDNMLhRS4oxQISlHSlxRigApaKKACijFGKAFooooAKWijFABS+/XHOPWkoJJUY5ycEjtWU3ZWKitdBf4mjbPKn6df/r1DaHe0gAHQFiRjPAB+ozViZvnEqKGBOfoD1/n+lVwjwXD7T8hbD5bOFJ4x+vT0rzcQ1GUX5nbTV00WFjBQbgVRuq
